import React from 'react';
import './Home.css'; // Ensure you have this CSS file

function Home() {
  return (
    <div className="home">
      <section className="about-me">
        <h1>About Me</h1>
        <p>
          Hello! I'm [Your Name], a [Your Profession]. I specialize in [Your Specialization].
          My passion for [Your Passion] drives me to continuously learn and grow in this field.
        </p>
        <div className="profile">
          <img src="/path-to-your-profile-image.jpg" alt="Profile" className="profile-image" />
          <p>
            I have [Number] years of experience in [Industry/Field]. My journey includes working
            on various projects and honing my skills in [Skills or Technologies].
          </p>
        </div>
      </section>
    </div>
  );
}

export default Home;
